import React from 'react';

const ImageCard = props => {
  const {
    embed_url,
    images: { fixed_width: url }
  } = this.props.image;
  return (
    <div id={props.key}>
      <img src={url} />
      <div>URL: {embed_url}</div>
    </div>
  );
};

export default ImageCard;
